using System;
using System.Collections.Generic;
using System.Linq;
using System.Linq.Expressions;
using System.Threading.Tasks;
using AutoMapper;
using EPlast.BLL.DTO.GoverningBody.Sector;
using EPlast.BLL.Interfaces.AzureStorage;
using EPlast.BLL.Services.GoverningBodies.Sector;
using EPlast.DataAccess.Entities.GoverningBody.Sector;
using EPlast.DataAccess.Repositories;
using Microsoft.EntityFrameworkCore.Query;
using Moq;
using NUnit.Framework;

namespace EPlast.Tests.Services.GoverningBody.Sector
{
    internal class SectorDocumentsServiceTests
    {
        private Mock<IRepositoryWrapper> _repoWrapper;
        private Mock<IMapper> _mapper;
        private Mock<IGoverningBodySectorFilesBlobStorageRepository> _blobStorage;
        private SectorDocumentsService _service;

        [SetUp]
        public void SetUp()
        {
            _repoWrapper = new Mock<IRepositoryWrapper>();
            _mapper = new Mock<IMapper>();
            _blobStorage = new Mock<IGoverningBodySectorFilesBlobStorageRepository>();

            _service = new SectorDocumentsService(
                _repoWrapper.Object,
                _mapper.Object,
                _blobStorage.Object
            );
        }

        [Test]
        public async Task GetAllSectorDocumentTypesAsync_ReturnsDocumentTypeDtoIEnumerable()
        {
            //Arrange
            _repoWrapper
                .Setup(x => x.GoverningBodySectorDocumentType.GetAllAsync(
                        It.IsAny<Expression<Func<SectorDocumentType, bool>>>(),
                        It.IsAny<Func<IQueryable<SectorDocumentType>, IIncludableQueryable<SectorDocumentType, object>>>()))
                .ReturnsAsync(new List<SectorDocumentType>());
            _mapper
                .Setup(x => x.Map<IEnumerable<SectorDocumentType>, IEnumerable<SectorDocumentTypeDTO>>(
                    It.IsAny<IEnumerable<SectorDocumentType>>()))
                .Returns(new List<SectorDocumentTypeDTO>());

            //Act
            var result = await _service.GetAllSectorDocumentTypesAsync();

            //Assert
            Assert.IsNotNull(result);
            Assert.IsInstanceOf<IEnumerable<SectorDocumentTypeDTO>>(result);
        }

        [Test]
        public async Task AddSectorDocumentAsync_CreatesDocumentInRepo()
        {
            //Arrange
            var testDocumentTypes = CreateDocumentTypes();
            _mapper
                .Setup(x =>
                    x.Map<IEnumerable<SectorDocumentType>, IEnumerable<SectorDocumentTypeDTO>>(
                        It.IsAny<IEnumerable<SectorDocumentType>>()))
                .Returns(testDocumentTypes);
            _mapper
                .Setup(x => x.Map<SectorDocumentsDTO, SectorDocuments>(It.IsAny<SectorDocumentsDTO>()))
                .Returns(new SectorDocuments());
            _repoWrapper
                .Setup(x => x.GoverningBodySectorDocumentType.GetAllAsync(
                    It.IsAny<Expression<Func<SectorDocumentType, bool>>>(),
                    It.IsAny<Func<IQueryable<SectorDocumentType>, IIncludableQueryable<SectorDocumentType, object>>>()))
                .ReturnsAsync(new List<SectorDocumentType>());
            _repoWrapper
                .Setup(x => x.GoverningBodySectorDocuments.Attach(It.IsAny<SectorDocuments>()));
            var testDocumentDto = CreateSectorDocumentsDto();

            //Act
            var result = await _service.AddSectorDocumentAsync(testDocumentDto);

            //Assert
            _blobStorage
                .Verify(x => x.UploadBlobForBase64Async(
                    It.IsAny<string>(), It.IsAny<string>()), Times.Once);
            _repoWrapper
                .Verify(x => x.GoverningBodySectorDocuments.Attach(
                    It.IsAny<SectorDocuments>()), Times.Once);
            _repoWrapper
                .Verify(x => x.GoverningBodySectorDocuments.CreateAsync(
                    It.IsAny<SectorDocuments>()), Times.Once);
            _repoWrapper.Verify(x => x.SaveAsync(), Times.Once);
            Assert.AreEqual(testDocumentDto, result);
        }

        [TestCase("test.pdf")]
        public async Task DownloadSectorDocumentAsync_ReturnsBlobName(string documentName)
        {
            //Arrange
            _blobStorage
                .Setup(x => x.GetBlobBase64Async(It.IsAny<string>()))
                .ReturnsAsync(documentName);

            //Act
            var result = await _service.DownloadSectorDocumentAsync(documentName);

            //Assert
            Assert.AreEqual(documentName, result);
        }

        [TestCase(1)]
        public async Task DeleteSectorDocumentAsync_DeletesFile(int documentId)
        {
            //Arrange
            _repoWrapper
                .Setup(x => x.GoverningBodySectorDocuments.GetFirstOrDefaultAsync(
                    It.IsAny<Expression<Func<SectorDocuments, bool>>>(),
                    It.IsAny<Func<IQueryable<SectorDocuments>, IIncludableQueryable<SectorDocuments, object>>>()))
                .ReturnsAsync(new SectorDocuments() { BlobName = "test" });

            //Act
            await _service.DeleteSectorDocumentAsync(documentId);

            //Assert
            _blobStorage.Verify(x => x.DeleteBlobAsync(It.IsAny<string>()), Times.Once);
            _repoWrapper.Verify(x => x.GoverningBodySectorDocuments.Delete(It.IsAny<SectorDocuments>()), Times.Once);
            _repoWrapper.Verify(x => x.SaveAsync(), Times.Once);
        }

        private SectorDocumentsDTO CreateSectorDocumentsDto()
        {
            return new SectorDocumentsDTO()
            {
                BlobName = "data:application/pdf;base64,",
                FileName = "test.pdf",
                SectorDocumentType = new SectorDocumentTypeDTO() { Id = 1, Name = "test" }
            };
        }

        private IEnumerable<SectorDocumentTypeDTO> CreateDocumentTypes()
        {
            return new List<SectorDocumentTypeDTO>()
            {
                new SectorDocumentTypeDTO() { Id = 1, Name = "test" }
            };
        }
    }
}
